import React from 'react';
import logo from '../polysialogo.png';

const Header = () => (
  <header id="header">
    <img id="logo" src={logo} alt="Logo" />
    <h4 id="logotitle">Polysia Tech</h4>
    <h1>ThreatMap Live Attack</h1>
  </header>
);

export default Header;
